import React from 'react';
import ExperienceMap from './ExperienceMap';
import '../styles/Map.css';

const MapPage = () => {
  return (
    <div>
      <h1 id='map-header'>Experience Map</h1>
      <div id="map-container">
        <ExperienceMap className="experience-map" />
      </div>
    </div>
  );
};

export default MapPage;
